INSERT INTO `association` (`id`, `address`, `category`, `name`, `OJIdentifier`, `description`, `mail`, `website`, `facebook`, `twitter`, `phonenumber`, `validate`) VALUES
(1, 1, 36, 'FACIAL (FORMATION AIDE ET CONSEIL EN INFORMATIQUE, ASSEMBLAGE ET LIAISONS. ', 'W012000057', 'fournir une aide aux associations dans le domaine de l''informatique, tant au niveau du conseil, que de la formation du personnel ou adhérents, de la mise en place de matériel, du choix de stratégie à adopter. ; Date de déclaration : 22/12/2008', NULL, NULL, NULL, NULL, NULL, 1),
(2, 2, 160, 'ENGLISH FOR FUN. ', 'W011000011', 'découverte de la langue anglaise et de la civilisation anglo-saxonne par le biais d''ateliers de langue anglaise et d''autres activités que les membres pourront proposer. ; Date de déclaration : 19/12/2008', NULL, NULL, NULL, NULL, NULL, 1),
(3, 3, 97, 'CANOË-KAYAK CERN. ', 'W013000013', 'organiser et développer la pratique du canoë-kayak et de ses disciplines associées ; contribuer à la protection de l''environnement nécessaire à sa pratique. ; Date de déclaration : 9/12/2008', NULL, NULL, NULL, NULL, NULL, 1),
(4, 4, 146, 'AMICALE DES CLASSES EN 9 DE SAINT TRIVIER SUR MOIGNANS. ', 'W012000074', 'réunir toutes les personnes ayant 10,20,30,401,50,60,70,80,90,100 ans chaque année finissant par 9 et organiser diverses manifestations. ; Date de déclaration : 12/12/2008', NULL, NULL, NULL, NULL, NULL, 1),
(5, 5, 141, 'AMICALE DES TRAVAILLEURS ET COMMERÇANTS MAROCAINS DE LA PLASTIC VALLEE. ', 'W014000045', 'regrouper l''ensemble de ses adhérents pour une action commune dans les domaines éducatif, culturel et social ; revalorisation du patrimoine culturel marocain parmi ses adhérents ; elle favorise le dialogue et la coopération. ; Date de déclaration : 15/01/2009', NULL, NULL, NULL, NULL, NULL, 1),
(6, 7, 146, 'AMICALE DES CONSCRITS DE CHALAMONT 1990. ', 'W012000115', 'organiser des manifestations ; son action s''étend sur le canton de Chalamont. ; Date de déclaration : 23/01/2009', NULL, NULL, NULL, NULL, NULL, 1),
(7, 9, 47, 'LA COMPAGNIE PERDUE. ', 'W011000144', 'créer et promouvoir des spectacles et des ateliers de danse, clown, mime et théâtre pour tous publics et toutes structures. ; Date de déclaration : 12/02/2009', NULL, NULL, NULL, NULL, NULL, 1),
(8, 10, 280, 'ASSOCIATION DES CO-PROPRIETAIRES SUR LA DIVONNE. ', 'W013000072', 'gérer les éventuels travaux communs à l''ensemble du bâtiment du 40 passage du moulin à Divonne. ; Date de déclaration : 29/01/2009', NULL, NULL, NULL, NULL, NULL, 1),
(10, 13, 133, 'CRAPAST. ', 'W013000097', 'permettre la pratique des activités physiques de pleine nature ; permettre à des personnes de se rassembler pour pratiquer des activités physiques de pleine nature, permettre le développement des activités physiques de pleine nature, mettre en place une ou plusieurs manifestations liées aux activités physiques de pleine nature. ; Date de déclaration : 25/02/2009', NULL, NULL, NULL, NULL, NULL, 1),
(12, 15, 295, 'ASSOCIATION DES ANCIENS COMBATTANTS DE PORT 01. ', 'W014000121', 'réunir en une association amicale des anciens combattants et victimes de guerre, ainsi que leurs familles pour commémorer ces évènements passés. ; Date de déclaration : 12/03/2009', NULL, NULL, NULL, NULL, NULL, 1),
(14, 17, 231, 'MAISON D''ACCUEIL RURALE POUR PERSONNES AGEES (MARPA) DE LA COMMUNAUTE DE COMMUNES DU CANTON DE PONT DE VAUX - MARPA DE LA VERCHERE. ', 'W012000278', 'mener à bien le projet de création de la MARPA de la Verchère initié et soutenu par la communauté de communes du canton de Pont-de-Vaux sur la commune de Pont-de-Vaux ; prendre à bail l''immeuble situé sur la commune de Pont-de-Vaux ; assurer la gestion et l''animation de la MARPA en favorisant la coordination et la gestion de toute action ou service appropriés avec le concours des associations ou organismes existant localement ; assurer à un coût maîtrisé le maintien des personnes âgées résidant sur le territoire d''action de la MARPA dans leur cadre habituel de vie. ; Date de déclaration : 12/03/2009', NULL, NULL, NULL, NULL, NULL, 1),
(16, 19, 280, 'ASSOCIATION GROBON. ', 'W012000501', 'faire valoir les droits des locataires et défendre leurs intérêts ; assurer les liens entre les locataires et le bailleur (Dynacite) ou la municipalité ou d''autres organismes ; transmettre au bailleur ou à la municipalité ou à d''autres organismes des demandes formulées par des locataires; demander des informations quant aux différentes charges et autres ; être à l''écoute des locataires et débattre de leurs propositions ou problèmes rencontrés relatifs au logement ; rechercher en commun des solutions et agir pour améliorer et préserver notre cadre de vie (environnement, bâtiment). ; Date de déclaration : 9/04/2009', NULL, NULL, NULL, NULL, NULL, 1),
(18, 23, 44, 'FESTI''VOIX. ', 'W012000559', 'permettre à de jeunes artistes débutants ainsi qu''à des amateurs motivés de s''exprimer ; organiser toutes manifestations permettant l''expression de ses membres. ; Date de déclaration : 22/04/2009', NULL, NULL, NULL, NULL, NULL, 1),
(20, 27, 267, 'BENY ENVIRONNEMENT. ', 'W012000584', 'lutte contre l''implantation d''un tracé L.G.V. (Ligne à Grande Vitesse) ses conséquences et nuisances sur le territoire de la commune de Bény et contre le développement du trafic sur la voie ferrée existante de la Bresse. ; Date de déclaration : 7/05/2009', NULL, NULL, NULL, NULL, NULL, 1),
(22, 29, 36, 'TEAM LORD. ', 'W013000169', 'organiser, coordonner, développer et promouvoir une pratique des jeux vidéo conviviale et sportive sous toutes ses formes ; participer ou organiser des compétitions onlines ou l''organisation de lan ; assurer la représentation des jeux vidéo sur le plan national et international. ; Date de déclaration : 16/04/2009', NULL, NULL, NULL, NULL, NULL, 1),
(24, 31, 42, 'ARTS GRAPHIQUES DE LOYETTES (A.G.L.). ', 'W011000319', 'initier exclusivement le dessin et la peinture aux adultes et créer de leurs mains l''art graphique qu''ils auront choisi (dessin sous toutes ses formes, etc.). ; Date de déclaration : 13/05/2009', NULL, NULL, NULL, NULL, NULL, 1),
(26, 35, 2, 'CHANGER POUR GAGNER. ', 'W014000230', 'participer au débat politique sur l''avenir du département de l''Ain et de la région Rhône-Alpes ; organisation de manifestations et de réunions d''information. ; Date de déclaration : 4/06/2009', NULL, NULL, NULL, NULL, NULL, 1),
(29, 39, 274, 'ASSOCIATION DE DEFENSE DES ADHERENTS SPORT2000 SPORT 2000 INVEST SPORT 2000 RETAIL. ', 'W012000696', 'défendre les droits des adhérents vis à vis de Sport 2000 France Sport 2000 Invest, Sport 2000 Retail ; elle utilisera tous les moyens d''action nécessaires pour réaliser correctement sa mission (article de presse, création d''un site internet, etc.). ; Date de déclaration : 18/06/2009', NULL, NULL, NULL, NULL, NULL, 1),
(31, 41, 46, 'KA'' DANS''. ', 'W013000221', 'promouvoir l''art et la culture créole (antillaise, mauricienne, haïtienne, africaine) sous toutes ses formes dans le pays de Gex ; créer un groupe d''enfants nés en métropole ou bien ailleurs, leur donnant la possibilité d''apprendre le folklore créole au son de nos tambours traditionnels (Gwo Ka, Djembé). ; Date de déclaration : 16/06/2009', NULL, NULL, NULL, NULL, NULL, 1),
(32, 43, 126, 'LE TENNIS ECHETOIS. ', 'W012000766', 'permettre aux habitants du village d''utiliser les terrains de tennis en loisir dans de bonne conditions avec le matériel nécessaire fourni par elle. ; Date de déclaration : 7/07/2009', NULL, NULL, NULL, NULL, NULL, 1),
(34, 45, 53, 'GUILDE DES AIRSOFTEURS DE L''AIN. ', 'W011000397', 'rassembler les joueurs d''airsoft de l''Ain afin d''organiser des parties encadrées et légales. ; Date de déclaration : 10/07/2009', NULL, NULL, NULL, NULL, NULL, 1),
(36, 48, 99, 'COMITE DE GESTION DU BOULODROME PORTE OUEST DE LA DOMBES. ', 'W012000780', 'gestion, développement et pratique du sport boules. ; Date de déclaration : 15/07/2009', NULL, NULL, NULL, NULL, NULL, 1),
(37, 49, 129, 'BIKE EVASION. ', 'W013000248', 'faire pratiquer le VTT dans un cadre convivial ; organiser des manifestations sportives basées sur la pratique du vélo tout terrain ; planifier des sorties en groupe sur le thème du vélo. ; Date de déclaration : 29/07/2009', NULL, NULL, NULL, NULL, NULL, 1),
(39, 52, 39, 'MOUVEMENT ET CREATION. ', 'W011000433', 'enseigner, initier les techniques corporelles liées à la danse (barre à terre) ainsi que faire décourvrir sous forme de cours ou de stages différents styles de danse ou d''expression corporelle ; promouvoir la créativité sous toutes formes autour de rencontres pluridisciplinaires, de créations artistiques , d''évènements culturels. ; Date de déclaration : 13/08/2009', NULL, NULL, NULL, NULL, NULL, 1),
(41, 54, 128, 'PAINTBALL ADDICT. ', 'W012000886', 'regrouper des joueurs de paint-ball; faire la promotion de cette activité sportive et organiser des parties avec des personnes extérieures à l''association. ; Date de déclaration : 3/08/2009', NULL, NULL, NULL, NULL, NULL, 1),
(43, 57, 146, 'LES STEPHANOIS DE LA 11. ', 'W012000985', 'rassembler les personnes du même âge, né ou résidant dans le village, pour organiser des festivités. ; Date de déclaration : 21/08/2009', NULL, NULL, NULL, NULL, NULL, 1),
(44, 59, 102, 'ASSOCIATION DES SPORTS EQUESTRES DE NANTUA. ', 'W014000281', 'faire pratiquer l''équitation sous toutes ses formes y compris pour les passages d''examens fédéraux et de compétitions, promouvoir le cheval et les activités équestres. ; Date de déclaration : 6/08/2009', NULL, NULL, NULL, NULL, NULL, 1),
(47, 63, 45, '100% DANSE ST VULBAS. ', 'W011000458', 'apprendre principalement à ses membres des danses en couple pour enfants et adultes ainsi que les danses en groupe, non présentes bien sûr sur leur commune, telles que la danse africaine, le hip hop et le disco danse. ; Date de déclaration : 8/09/2009', NULL, NULL, NULL, NULL, NULL, 1),
(49, 66, 232, 'AMBITION RESEAUX. ', 'W012001077', 'financement partiel et aménagement juqu''à réception par et au bénéfice du lycée professionnel Alexandre Bérard à Ambérieu-en-Bugey, d''une plateforme technique destinée à la formation de monteurs de réseaux électriques HT et BT, aériens et souterrains, sur un terrain utilisé par le lycée. ; Date de déclaration : 11/09/2009', NULL, NULL, NULL, NULL, NULL, 1),
(51, 68, 267, 'ASSOCIATION DOMANIALE. ', 'W012001119', 'préserver les droits des propriétaires ; respecter l''environnement, l''urbanisme, la sécurité de tous, la citoyenneté au sein de la rue du Domaine ; créer et organiser d''éventuelles manifestations rue du Domaine. ; Date de déclaration : 01/10/2009', NULL, NULL, NULL, NULL, NULL, 1),
(54, 72, 98, 'BADMINTON SUD GESSIEN. ', 'W013000311', 'pratique du badminton. ; Date de déclaration : 13/10/2009', NULL, NULL, NULL, NULL, NULL, 1),
(55, 74, 47, 'PARTICIPE PRESENT. ', 'W011000580', 'développer la pratique du théâtre et favoriser l''expression à travers l''organisation de cours, de stages, de rencontres autour de l''univers du théâtre. ; Date de déclaration : 26/10/2009', NULL, NULL, NULL, NULL, NULL, 1),
(57, 76, 95, 'HANDISPORT POUR TOUS (HPT). ', 'W011000594', 'permettre aux personnes handicapées, tous handicaps confondus, de pratiquer des activités sportives ; achat de matériel adapté (fauteuil tennis, fauteuil de ski, hand bike, quand, kart) ; mise en place de stages d''initiation tous niveaux, promotion de l''handisport dans les écoles, les centres de rééducation pour faire prendre conscience aux gens et aux personnes handicapées particulièrement de la multitude de sports qu''il est possible de pratiquer malgré l''handicap ; mise en place de journées découvertes (canoë kayak, quad, karting) ; soutien et suivi des jeunes désirant pratiquer l''handisport en compétitions. ; Date de déclaration : 28/10/2009', NULL, NULL, NULL, NULL, NULL, 1),
(59, 78, 148, 'ASSOCIATION AUTONOME DE PARENTS D''ELEVES. ', 'W013000335', 'aider les parents pour ce qui concerne la vie scolaire de leurs enfants, en les informant sur le fonctionnement et l''évolution du système éducatif et en leur proposant des services liés à la scolarité de leurs enfants (bourse aux livres, service d''assurance scolaire etc) ; représenter les parents d''élèves de l''enseignement public auprès des établissements scolaires, du corps enseignant, des autorités académiques, du rectorat, des collectivités locales, des pouvoirs publics et de tout organisme concerné par l''enseignement public ; coopérer avec les instances et organismes désignés ci-dessus à tout ce qui concerne l''éducation et l''enseignement, participer à la réflexion et à l''élaboration de toute amélioration, modification ou projet de réforme de l''enseignement ; participer au respect et à la promotion des principes et des valeurs du mouvement autonome : primauté et responsabilité des parents dans les choix éducatifs, neutralité politique, syndicale, idéologique et religieuse du système éducatif, qualité de l''enseignement public, éducation aux valeurs civiques et morales : ses des responsabilités et de l''effort, respect d''autrui, des droits et des devoirs du citoyen. Elle s''oblige elle-même à une absolue neutralité politique ; elle s''interdit au cours de ses réunions toute discussion à caractère politique, syndical ou religieux et elle demande à ses adhérents cette même neutralité. ; Date de déclaration : 29/09/2009', NULL, NULL, NULL, NULL, NULL, 1),
