(96, 124, 250, 'CLUB DES AUTO-ENTREPRENEURS DE L''AIN (CLUBAE01). ', 'W012002219', 'distribuer une information et un service commun de proximité aux auto-entrepreneurs ; a une mission d''accompagnement aux auto-entrepreneurs de son département ; favorise leurs expressions, leurs rencontres et leurs échanges par une réunion mensuelle au minimum ; apporte à ceux-ci toutes informations et tous conseils utiles pour leur développement ; accompagne et propose une démarche de professionnalisation et de labellisation à ses adhérents en se référant au code de déontologie des auto-entrepreneurs ; remonte les informations stratégiques et les outils développés à destination de la fédération des auto-entrepreneurs qui s''engage à mutualiser les moyens mis en oeuvre et développés par tous les clubs départementaux d''auto-entrepreneurs pour l''ensemble du réseau national ; fait parvenir de manière régulière la liste des membres du club pour intégration à la lettre d''information hebdomadaire rédigée par la Fédération ainsi que les comptes rendus des réunions réalisées ; créer et assurer directement d''autres dispositifs de conseil et d''assistance aux auto-entrepreneurs ; par son écoute et sa proximité territoriale avec ses adhérents le club assure leur promotion et leur représentation et élabore des propositions susceptibles de développer ou de faire évoluer ce régime en particulier dans son département ; créer et administrer à titre principal ou en association avec d''autres partenaires tout établissement de formation professionnelle initiale ou continue dans les conditions prévues aux articles L. 443-1 et L. 753-1 du code de l''éducation et pour la formation continue dans le respect du droit de la concurrence ; contribue au développement économique du territoire ; accomplir toute opération pouvant se rapporter directement ou indirectement à l''objet social, lui être utile ou susceptible d''en faciliter la réalisation. ; Date de déclaration : 19/02/2010', NULL, NULL, NULL, NULL,