(101, 130, 146, 'LES ZEROS POINTES. ', 'W012002313', 'regrouper en priorité les personnes nées en années zéro habitantes ou ayant habité la commune de Ceyzériat ou toutes personnes natives de Ceyzériat et résidant à l''extérieur de la commune ou toutes autes personnes nées en années zéro désirant devenir membres de l''association et étant cooptées par un vote à la majorité simple du comité directeur, la voix du président est prépondérante en cas d''égalité ; favoriser le rassemblement à des fins culturelles, sportives, gastronomiques, touristiques, de façon à développer des relations d''amitié dans le respect des lois et réglements en vigueur entre les personnes nées en années zéro ainsi que leurs conjoint, famille et amis originaires ou ayant leurs résidences principales ou secondaires sur la commune de Ceyzériat ; organiser pour elle même ou d''autres associations toutes distractions, voyages, repas, spectacles, manifestations culturelles, ludiques, festives, sportives ou sociales ; favoriser le rapprochement avec d''autres associations ayant des membres de même nature ou des objets et des vocations semblables et établir avec elles tous types de conventions, chartes, projets ou autres ; aider, soit par des dons ou par d''autres formes d''aides ou soutiens toute personne ou groupe de personnes que l''association jugera méritans. ; Date de déclaration : 01/04/2010', NULL, NULL, NULL, NULL, NULL, 1),
