(382, 471, 232, 'JULITZEN. ', 'W011001625', 'promotion de l''enseignement et pratique du yoga tout en favorisant la connaissance des disciplines de l''enseignement et la pratique du yoga tout en favorisant la connaissance des disciplines qui y sont associées et de manières non exhaustive la respiration, la relaxation, la diététique, le massage, l''herboristerie, les techniques de développements personnel, la sophrologie, la réflexologie, le reiki, l''astrologie, les méthodes mezières, feldenckais, gesfalt, la bio-énergie, la naturopaphie, la P-N-L, les massages et gommages, la relaxation, la visualisation, la gestuelle libératrice, la gymnastique douce, le travail sur la voix, les activités d''expressions telle que théâtre, peinture, danses, calligraphie, les activités de plein nature telles que marche, randonnées, les voyages ; mise en place de formation professionalisante pour un ou plusieurs de ses membres dont les modalités sont définies par le conseil d''administration avec approbation de l''assemblée générale ; toutes opérations industrielles, commerciales ou financières, mobilières ou immobilières, pouvant se : contribuer au fonctionnement de l''association par le paiement d''une cotisation annuelle dont le montant et les modalités de versement sont fixés par le Comité Directeur ; s''engager à respecter les principes définis dans l''article 2 des présents statuts ; s''engager à respecter le règlement intérieur. Les enfants de moins de 16 ans sont admis au sein de l''association sous le couvert et avec l''autorisation écrite de leurs parents ou tuteur légal. Ils deviennent de plein droit membres actifs à l''âge de 16 ans révolus. Est membre bienfaiteur, toute personne physique ou morale rendant ou ayant rendu des services éminents à l''association sous forme de dons manuels ou de collaboration occasionnelle. Ils sont dispensés de cotisations ; tout représentant d''organismes associatifs ou d''administrations sur acceptation du Conseil. Sont membres d''honneur toutes personnes morales ou physique reconnues comme telles par l''assemblée générale en raison de services rendus à l''association. Elles sont dispensées de cotisations. Sont membres moraux les associations régies par les dispositions de la loi du 1er juillet 1901 et le décret du 16 août 1901 représentées par leurs présidents respectifs. Les membres moraux doivent s''acquitter d''une cotisation dont le montant est fixé annuellement par le Comité Directeur. Pour faire partie de l''association, il faut être agrée par le bureau qui statue, lors de ses réunions, sur les demandes d''admission présentées. Sont membres associés les associations adhérentes dans les conditions d''une convention, stipulant dans leurs statuts et dans les faits leur activité de yoga, et leur adhésion au règlement intérieur de l''Association et paiement d''une cotisation, des dons manuels, de toutes ressources autorisées par la loi. ; Date de déclaration : 23/09/2013', NULL, NULL, NULL, NULL, NULL, 1),
