(423, 517, 192, 'SANTE AMOUR SEXUALITE (SAS). ', 'W012008678', 'contribuer au développement et à la notoriété de la Psycho-Sexoanalyse et des pratiques thérapeutiques visant au mieux-être psychologique, relationnel et physique des personnes ; favoriser les contacts entre thérapeutes ; toute autre activité concourant directement ou indirectement aux buts précédents. ; Date de déclaration : 12/03/2014', NULL, NULL, NULL, NULL, NULL, 1),
(425, 519, 221, 'ACTIONS ET INITIATIVES SUD DEVELOPPEMENT ANIYA. ', 'W013001036', 'entreprendre des actions d''accompagnement et d''appui des structures étatiques, associatives ou toute personne publique ou privée en vue du renforcement de la lutte contre la pauvreté et la promotion du développement des pays du Sud. ; Date de déclaration : 19/03/2014', NULL, NULL, NULL, NULL, NULL, 1),
(427, 521, 269, 'ASSOCIATION DU SECTEUR PAVILLONNAIRE DU TERRAILLET. ', 'W013001041', 'défendre la qualité de la vie du quartier autour des: Chemin de la Planche Brûlée, Route de Prévessin, Chemin du Terraillet et plus généralement dans la commune de Ferney-Voltaire et ses environs (habitat, environnement, circulation, service public, sécurité, santé); veiller au développement harmonieux du quartier et de la commune notamment en participant à l''élaboration des règles d''urbanisme et en oeuvrant, y compris en justice, contre les décisions administratives qui portent atteinte aux caractéristiques urbaines du quartier; mutuellement informer les habitants sur tous projets et réalisations concernant le quartier, la commune et ses environs; donner son avis en matière de construction, d''aménagement et d''urbanisme dans les conditions du code de l''urbanisme; préserver l''espace, permettant des activités propres à l''épanouissement, l''entraide et la solidarité entre les habitants et entre les générations; veiller à la préservation du cachet du quartier, du cadre de vie et de la qualité de l''environnement; veiller à éviter toute dévalorisation des habitations dans le quartier; sauvegarder la diversité des logements dans la commune; veiller au maintien de structures scolaires adéquates dans le périmètre du quartier, dans la commune et ses environs; promouvoir et valoriser la convivialité, l''action festive et la cohésion sociale parmi les habitants; défendre les intérêts des habitants du quartier dans tous les domaines sus-mentionnés, y compris par l''action en justice. ; Date de déclaration : 3/04/2014', NULL, NULL, NULL, NULL, NULL, 1),
