(431, 526, 49, 'BIG GENEVA MUSIC ASSOCIATION (BGM ASSOCIATION). ', 'W013001047', 'déployer ses activités dans le domaine des musiques jouées en live par des musiciens amateurs ; son but est la découverte et la pratique de toutes les musiques au plus grand nombre, sans distinction de style ou de mode, dès l''instant où elles sont jouées par des musiciens ; l''association adresse son action aux talents musicaux basés dans la région du grand genève et au delà des frontières de manière exceptionnelle ; elle peut être appelée à intervenir dans le financement de la production enregistrée en live ou des spectacles vivants ; elle pourra apporter un soutien au placement d''artistes, occasionnellement faire appel à des musiciens professionnels pour leurs conseils et leur savoir pouvant au besoin, dispenser quelques cours ; l''association participe à l''animation de la vie locale en réintroduisant la musique vivante par son engagement dans les manifestations, fête de la musique,Téléthon, etc., par la recherche de concerts dans toute la région du Grand Genève et au delà des frontières, nouant des relations avec les organisateurs, administrateurs des lieux de concerts, de clubs, de festivals, les acteurs culturels, entreprises privées, autorités contribuant au rayonnement de la culture. ; Date de déclaration : 15/04/2014', NULL, NULL, NULL, NULL, NULL, 1),
