(503, 621, 102, 'L''EQUIPAGE DE MAILLAT. ', 'W014001238', 'animer le centre équestre "Equi Maillat" ; organiser des activités socio-culturelles ; soutenir les participations aux concours équestres ; favoriser l''accès des personnes défavorisées ou handicapées à l''équitation. ; Date de déclaration : 14/04/2015', NULL, NULL, NULL, NULL, NULL, 1),
(504, 623, 92, 'SPELEO-CLUB BELLEGARDE VALSERINE (SCBV). ', 'W014001241', 'l''union de toutes personnes pratiquant ou étudiant la spéléologie et la descente de canyon ; la recherche scientifique, la promotion et l''enseignement de la spéléologie et de la descente de canyon, la protection du monde souterrain et son environnement ; l''organisation, seule ou associée, de manifestations ayant un rapport avec la spéléologie ou la descente de canyon et son environnement, à ce titre l''association concoure à l''éducation physique et morale de la jeunesse ; le développement des partenariats d''actions sur ces espaces en collaboration avec les collectivités, les acteurs locaux et tout organisme concerné. ; Date de déclaration : 20/04/2015', NULL, NULL, NULL, NULL, NULL, 1),
(506, 625, 217, 'EGALITE POUR TOUS. ', 'W013001152', 'lutter contre toutes formes de racisme, de discrimination et d''injustice faites par une tierce personne ou une administration/institution ; défendre toute personne physique ou morale, victime d''un traitement discriminatoire en raison de son patronyme, sa race, son faciès, son appartenance à sa région, à son groupe ethnique ou à sa croyance ; oeuvrer pour les réformes juridiques en faveur de la lutte contre l''exclusion, la discrimination et l''injustice ; inciter les pouvoirs publics à veiller aux aspirations des groupes minoritaires ethniques, religieux et linguistiques, et de garantir leurs droits et favoriser leur participation à la société ; combattre l''injustice, l''arbitraire et toutes formes d''intolérances, de violences et de tortures ; contribuer à vulgarisations des principes des libertés, de la démocratie, des droits de l''homme et de la laïcité ; contribuer à la promotion de l''égalité de tous pour tout ; apporter une aide psychosociale : éducative, sanitaire, alimentaire etc. ; Date de déclaration : 7/04/2015', NULL, NULL, NULL, NULL, NULL, 1),
(509, 629, 66, 'LES MICHEL''S. ', 'W012009855', 'organiser des évènements culturels, touristiques, gastronomiques, festifs, favoriser les échanges, les rencontres entre les Michel''s, leurs familles, amis qui résident à Chalamont et ses environs. ; Date de déclaration : 12/05/2015', NULL, NULL, NULL, NULL, NULL, 1),
(511, 632, 49, 'CULTURE JEUNESSE GESSIENNE. ', 'W013001163', 'accompagner et développer les projets culturels des jeunes gessiens depuis leur création jusqu''à leurs aboutissement ; art, sport, musique ; organiser plusieurs activités économique promotionnelles et qui aura pour but de financer certains projets et permettant un rayonnement de la culture urbaine des jeunes gessiens. ; Date de déclaration : 4/01/2015', NULL, NULL, NULL, NULL, NULL, 1),
(513, 634, 39, 'LES VIEILLES CANAILLES GESSIENNES. ', 'W013001169', 'l''animation culturelle ou récréative de lieux de préférence insolites ; l''administration et la gestion du groupe musical les vieilles canailles gessiennes dans sa démarche culturelle ou récréative. ; Date de déclaration : 27/05/2015', NULL, NULL, NULL, NULL, NULL, 1),
(516, 638, 297, 'L''ASSOCIATION LEG. ', 'W011001955', 'découvrir, enseigner et partager tout moyen qui permette à tout être vivant, en relation avec tout ce qui l''entoure, de développer son autonomie, en accord avec les lois de la vie, pour que toute ressource, dans tous les domaines, devienne libre d''accès et gratuite. ; Date de déclaration : 23/06/2015', NULL, NULL, NULL, NULL, NULL, 1),
(517, 640, 39, 'LES ZICOS DE VERSONNEX. ', 'W013001172', 'animer un groupe de musiciens amateurs. ; Date de déclaration : 4/06/2015', NULL, NULL, NULL, NULL, NULL, 1),
(519, 645, 203, 'ASSOCIATION ST GENIS HARMONIE. ', 'W013001179', 'accueillir, écouter et aide administrative aux habitants de Saint Genis Pouilly en particulier les habitants du quartier Jacques Prévert : cours de français, ateliers de savoirs sociolinguistiques et aide à l''insertion socio professionnelle. ; Date de déclaration : 22/06/2015', NULL, NULL, NULL, NULL, NULL, 1),
