(522, 649, 45, 'KREADANSE. ', 'W013001186', 'promouvoir la danse au sein du Pays de Gex ; mettre en avant les chorégraphies de Catherine Bundschuh à travers différents spectacles en collaboration avec d''autres intermittents du spectacle. ; Date de déclaration : 8/08/2015', NULL, NULL, NULL, NULL, NULL, 1),
(524, 651, 194, 'FEDERATION MONDIALE POUR L EDUCATION MEDICALE. ', 'W013001189', 'améliorer la qualité de l''éducation médicale dans le monde et garantir les plus hauts standards en matière d''éducation médicale ; garantir une amélioration de la qualité des soins médicaux pour l''humanité entière. ; Date de déclaration : 6/07/2015', NULL, NULL, NULL, NULL, NULL, 1),
(526, 653, 172, 'ASSOCIATION DE LA MAISON DE SANTÉ DE VERSONNEX. ', 'W013001192', 'créer un outil pour améliorer l''accès aux soins et à la prévention de la population ; contribuer à améliorer la qualité des soins en développant la coopération entre les différents professionnels de santé en vue d''une véritable coordination des soins ; permettre la mise en oeuvre des actions de santé publique et de prévention ; acquérir et gérer les biens et services nécessaires à la réalisation de ses objectifs. ; Date de déclaration : 15/07/2015', NULL, NULL, NULL, NULL, NULL, 1),
(529, 660, 39, 'DIRT ASSOCIATION. ', 'W013001198', 'nourrir vie harmonieuse entre les humains et leur habitat ; soutenir et organiser des évènements et des rencontres dans le but de lancer des débats d''idées et d''actions concrètes sur la relation entre les humains l''habitat la terre les conditions matérielles et la nature ; plaider pour la création et le soutien des cultures et des modes d''être locaux nationaux et inter-nations qui invitent interaction intime entre les êtres humains leur environnement et leurs pratiques culturelles ; promouvoir l''approche éducative pour encourager les individus et les communautés à récupérer ou à découvrir des pratiques culturelles et sociales qui reconnaît l''importance vitale de notre environnement ; soutenir et diffuser les expériences et projets variés dans de nombreuses cultures et des pratiques qui visent à combler le fossé entre la nature et culture différentes. ; Date de déclaration : 24/06/2015', NULL, NULL, NULL, NULL, NULL, 1),
