(554, 692, 275, 'GROUPEMENT D''EMPLOYEURS DES LYS. ', 'W014001312', 'la mise à disposition de ses membres, d''un ou plusieurs salariés liés au groupement par un contrat de travail ; cette mise à disposition s''exerce dans le cadre d''une gestion collective et mutualisée des emplois nécessaires aux travaux des adhérents ; le groupement d''employeurs ne peut effectuer d''opération à but lucratif ; le groupement d''employeurs est constitué dans le champ professionnel de la convention collective des exploitants agricoles du département de l''Ain. ; Date de déclaration : 20/01/2016', NULL, NULL, NULL, NULL, NULL, 1),
