(558, 698, 172, 'ACCÈS INTELLIGENT À LA SANTÉ POUR TOUS. ', 'W013001239', 'faciliter l''accès aux soins de santé et au suivi médical des personnes isolées ou en marge du développement global, par la création et la mise en place d''outils utilisant les technologies de l''information et de la communication et plus généralement d''apporter à des communautés et individus en situation défavorisée un outil d''émancipation pour un accès intelligent au vrai savoir et des services de base grâce aux TIC. ; Date de déclaration : 7/01/2016', NULL, NULL, NULL, NULL, NULL, 1),
