(564, 706, 87, 'ASSOCIATION POUR LA RESTAURATION DE L''EGLISE DE LAPEYROUSE (A.R.E.L). ', 'W012010317', 'soutenir, promouvoir, collecter des fonds pour contribuer au financement des travaux de consolidation, sauvegarde, restauration et mise en valeur de l''église de Lapeyrouse, élément du patrimoine communal et édifice cultuel. ; Date de déclaration : 3/03/2016', NULL, NULL, NULL, NULL, NULL, 1),
(565, 708, 66, 'ASSOCIATION SOCIO-CULTURELLE CALAS LA MONTAGNE. ', 'W014001337', 'promouvoir et développer les loisirs, les animations, les distractions et la culture sur son territoire ; à l''écoute des adhérents (es), elle ambitionne d''organiser et de réaliser des animations, manifestations de loisirs, rencontres, échanges, voyages, activités culturelles, physiques ou sportives ; l''association agit pour rompre l''isolement et la solitude par des activités de proximité dans un esprit de rencontre, de partage et d''enrichissement mutuel et solidaire ; elle contribue au renforcement des liens sociaux et citoyens pour la population ; elle dynamise la vie associative locale ; cette association pourra ponctuellement utiliser l''exploitation de la licence IV, détenue par la commune de Challes-la-Montagne, dans le respect des conditions stipulées par la réglementation en vigueur (lieu salle des fêtes) ; l''association est responsable financièrement et juridique de ses activités. ; Date de déclaration : 25/03/2016', NULL, NULL, NULL, NULL, NULL, 1),
