(573, 719, 39, 'LA FLAMME DU FREESIA. ', 'W013001268', 'promouvoir des activités inter-culturelles au profit de la diaspora telle que partager et échanger sur différents thèmes se retrouver autour du verre de l amitié gouter à des plats de divers horizons et même au delà ; promouvoir la vocation l''entraide la solidarité et le renforcement des liens d''amitiés et de fraternités au sein de cette même diaspora. ; Date de déclaration : 4/04/2016', NULL, NULL, NULL, NULL, NULL, 1),
