(577, 723, 297, 'COMMUNAUTÉ APOSTOLIQUE INTERNATIONAL. ', 'W013001276', 'l ''association évangélique chrétienne, communauté apostolique international vise à célébrer le culte de dieu et aussi à proclamer l''évangile de notre seigneur jésus christ dans tout le territoire national et à l''étranger, conformément aux ecritures qui sont sa seule règle de fois et pratique. ; Date de déclaration : 7/04/2016', NULL, NULL, NULL, NULL, NULL, 1),
