(585, 735, 56, 'LES JEUX DE KAZOK. ', 'W014001363', 'rassembler des personnes autour de jeux de sociétés, jeux de plateaux, jeux de cartes, jeux de figurines, jeux de rôles ; promouvoir la pratique du jeu auprès de tous types de joueurs (enfants, adolescents, adultes) et de tous niveaux (débutants, confirmés, réguliers ou occasionnels) ; permettre au plus grand nombre d''avoir la possibilité de jouer hors des rassemblements et chez eux par le biais de la location de jeux ; organiser des évènements à thème sur un ou plusieurs jours. ; Date de déclaration : 27/06/2016', NULL, NULL, NULL, NULL, NULL, 1),
